"use strict";(self.webpackChunkkywk_moco=self.webpackChunkkywk_moco||[]).push([[6146],{9780:function(t){t.exports=JSON.parse('{"blogPosts":[{"id":"/2022/06/07/wwdc","metadata":{"permalink":"/moco/news/2022/06/07/wwdc","source":"@site/news/2022/06-07-wwdc.md","title":"WWDC 2022","description":"2022.06.07 WWDC 2022","date":"2022-06-07T00:00:00.000Z","formattedDate":"2022\u5e746\u67087\u65e5","tags":[{"label":"apple","permalink":"/moco/news/tags/apple"}],"readingTime":2.61,"truncated":false,"authors":[{"name":"kywk","title":"Site Maintainer","url":"https://github.io/kywk","imageURL":"https://github.com/kywk.png","key":"kywk"}],"frontMatter":{"title":"WWDC 2022","description":"2022.06.07 WWDC 2022","authors":"kywk","tags":["apple"],"image":"https://i.imgur.com/mErPwqL.png","hide_table_of_contents":true},"nextItem":{"title":"The Future of the GitLab Web IDE","permalink":"/moco/news/2022/05/24/gitlab-web-ide"}},"content":"\u4e00\u5982\u5f80\u5e38\u860b\u679c\u958b\u767c\u8005\u5e74\u6703, WWDC \u4e3b\u8981\u8457\u91cd\u5728 OS \u65b9\u9762\u7684\u66f4\u65b0, \u6bd4\u8f03\u5c11\u786c\u9ad4\u76f8\u95dc\u767c\u8868.\\n\u800c\u5f9e 2020 \u4e00\u9cf4\u9a5a\u4eba\u7684 M1 \u8655\u7406\u5668\u9762\u4e16\u4e4b\u5f8c, \u860b\u679c\u5927\u578b\u767c\u8868\u6703\u5e7e\u4e4e\u90fd\u6709\u66f4\u5f37\u5927\u5f8c\u7e8c\u66f4\u65b0\u767c\u8868.\\n\u5f9e M1 Pro / M1 Max / M1 Ultra, \u9019\u6b21\u5247\u767c\u8868\u4e86 M2 \u8655\u7406\u5668.\\n\\n![](https://lh3.googleusercontent.com/pw/AM-JKLUS3s2ZxQ08lmQy9o2b_-rtk7MPtbtYUrqBuwbxn68l2ZjFZ92o-79qlA4Z7dJCy7vdag4QuiDw2tTyrDFiq1D_Y0YrsHbyQy5pRmiMDVeBixwV6f1WiKw8OQK7n1IPz-2IM0pmGcyhTqrO8ujAgENt8g=w730-no?authuser=0)\\n\\n\u6709\u8da3\u7684\u662f, \u5728\u5b98\u65b9\u767c\u8868\u7684\u8a0a\u606f\u770b\u4f86, M2 \u8655\u7406\u5668, \u9664\u4e86\u63a1\u7528\u65b0\u4e00\u4ee3\u7684 5nm \u88fd\u7a0b\u5916, \\n\u672c\u8cea\u67b6\u69cb\u4e0a\u4f3c\u4e4e\u662f\u548c M1 \u4e00\u6a23, \u7531 A14 \u9b54\u6539\u800c\u4f86\u7684\u7248\u672c. \\n\u671f\u5f85\u7684\u4ee5 A15 \u6838\u5fc3\u767c\u5c55\u800c\u4f86\u7684 M2 \u4f3c\u4e4e\u9084\u5728\u8def\u4e0a?\\n\\n\u904e\u53bb Intel CPU, \u4ee5\u67b6\u69cb\u548c\u88fd\u7a0b\u5404\u6bcf\u5169\u5e74\u4e00\u6b21\u91cd\u5927\u66f4\u65b0\u4ea4\u932f\u767c\u8868\u805e\u540d\u7684 Tick-Tock \u6230\u7565, \\n\u800c\u597d\u4e9b\u6642\u9593\u767c\u8868\u6548\u80fd\u53c8\u4e0d\u7b26\u5408\u671f\u5f85, \u88ab\u6232\u7a31\u70ba\u64e0\u7259\u818f.\\n\\nM2 \u76f8\u5c0d\u65bc M1 \u5df2\u6709\u5169\u5e74\u6642\u9593, \u9ad4\u8cea\u67b6\u69cb\u4e0a\u6c92\u6709\u6539\u8b8a, \u800c\u662f\u88fd\u7a0b\u7684\u6210\u9577\u5e36\u4f86\u4e86\u6548\u80fd\u63d0\u6607.\\n\u5169\u5e74\u4e4b\u5f8c\u7684\u6548\u80fd\u63d0\u6607\u4e86 18%, \u4f3c\u4e4e\u548c\u64e0\u7259\u818f\u6642\u671f\u7684 Intel \u5dee\u4e0d\u591a?\\n\u671f\u8a31 Apple \u5225\u8d70\u5411 Intel \u5f8c\u5875, \u671f\u5f85\u5e02\u5834\u4e0a\u6709\u591a\u6a23\u5404\u81ea\u7279\u8272\u7684\u7522\u54c1\u4f9b\u61c9\u9078\u64c7.\\n\\n![](https://lh3.googleusercontent.com/pw/AM-JKLW4veGa_SdcqdqW7DQ9GbTayruErPhiGYX5hKpWg806evFR3yu9TF_CFd3iJF3p9bATP_Cm8nMvgdx5YkOU7mpEdYzEsNApk3syao4KmDP1z3lKthY1o4gAKq5gBu_Mt_BFQP2WC2xm6S0iNuMHs7S-eQ=w730-no?authuser=0)\\n\\nWWDC 2022 \u4e0a\u53e6\u4e00\u500b\u65b0\u786c\u9ad4\u662f\u548c 2020 M1 \u4e00\u8d77\u767c\u8868\u7684 Macbook Air / Macbook Pro 13\\".\\n\u5176\u4e2d Macbook Pro 13\\" \u9664\u4e86 CPU \u5347\u7d1a\u5916, \u5176\u9918\u90fd\u548c M1 \u7248\u672c\u4e00\u6a23. \\n\u53ef\u4ee5\u770b\u5f97\u51fa\u4f86 MBP 13\\" \u6e96\u5099\u8d70\u5165\u6b77\u53f2\u4e86, \u7531 MBP 14\\" \u53d6\u4ee3.\\n\\n\u800c M2 Macbook Air \u5404\u9805\u8a2d\u8a08\u8a9e\u8a00\u4e5f\u548c MBP 14\\"/16\\" \u770b\u9f4a. \\n\u770b\u4f86\u6211\u6240\u4e0d\u559c\u6b61\u7684\u5916\u8868, \u6703\u662f\u672a\u4f86\u597d\u6bb5\u6642\u9593 Macbook \u7cfb\u5217\u7684\u7d71\u4e00\u9577\u76f8.\\n\u800c\u6211\u6700\u671f\u5f85\u7684 Macbook 12\\" \u4e26\u6c92\u6709\u5f8c\u7e8c\u6a5f\u7a2e\u7684\u6d88\u606f, \u770b\u4f86\u662f\u5fb9\u5e95\u8d70\u5165\u6b77\u53f2\u4e86.\\n\\n![](https://lh3.googleusercontent.com/pw/AM-JKLVAkugWj_CkFkerYIm4IO1hvSaasgKxKDWU17HYdPr8m1g8hdqoS6Ru7tCE_09ccaCdIoTAgdNlUeGVbnvTDmrYZk5mBA9hMGUufGYUHTKqD9f2lyxFhBoLNl2Hvo8xjhEAbhdeYCNL7XCr02saLTT6ag=w800-no?authuser=0)  \\n\\n![](https://lh3.googleusercontent.com/pw/AM-JKLVLlItlN1Y5DcqmH9Csjr-8XidI2xpGfl6Wl5hBTMzEq4E9FF3PNIq5OzcERMECrKri6DiYNX3Aoef09OHilmZ1otLnvQ8929iJ0hH2EJ7K_YO-MVIXCLtjDaSNnKzjJrlKrtO85E23ldvPSeK6WmVZTw=w800-no?authuser=0)\\n\\n\u800c WWDC \u4e0a\u4e3b\u8ef8\u7684\u8edf\u9ad4\u66f4\u65b0, \u4e00\u65b9\u4fbf\u89ba\u5f97 3C \u6574\u5408\u78ba\u5be6\u8d8a\u4f86\u8d8a\u65b9\u4fbf\u4e86.\\n\u624b\u6a5f / \u5e73\u677f / \u96fb\u8166\u7684\u5354\u540c\u5de5\u4f5c\u8d8a\u4f86\u8d8a\u7121\u7e2b\u929c\u63a5. \\n\\n\u4e0d\u904e\u860b\u679c\u81ea\u6210\u9ad4\u7cfb\u7684\u751f\u614b\u5708\u4f3c\u4e4e\u4e5f\u8d8a\u4f86\u8d8a\u6392\u5916, \\n\u8fd1\u5e74\u4f86\u8a31\u591a\u65b0\u529f\u80fd, \u5c0d\u65bc\u975e\u5b8c\u5168\u860b\u679c\u9ad4\u7cfb\u7684\u7528\u6236, \u662f\u5f88\u7121\u611f\u7684."},{"id":"/2022/05/24/gitlab-web-ide","metadata":{"permalink":"/moco/news/2022/05/24/gitlab-web-ide","source":"@site/news/2022/05-24-gitlab-web-ide.md","title":"The Future of the GitLab Web IDE","description":"2022.05.24 The Future of the GitLab Web IDE","date":"2022-05-24T00:00:00.000Z","formattedDate":"2022\u5e745\u670824\u65e5","tags":[{"label":"gitlab","permalink":"/moco/news/tags/gitlab"}],"readingTime":1.33,"truncated":true,"authors":[{"name":"kywk","title":"Site Maintainer","url":"https://github.io/kywk","imageURL":"https://github.com/kywk.png","key":"kywk"}],"frontMatter":{"title":"The Future of the GitLab Web IDE","description":"2022.05.24 The Future of the GitLab Web IDE","authors":"kywk","tags":["gitlab"],"image":"https://i.imgur.com/mErPwqL.png","hide_table_of_contents":true},"prevItem":{"title":"WWDC 2022","permalink":"/moco/news/2022/06/07/wwdc"},"nextItem":{"title":"Awesome Resources","permalink":"/moco/news/awesome"}},"content":"[GitLab \u767c\u8868\u65b0 WebIDE \u7684\u7279\u8272\u8207\u6574\u5408\u8aaa\u660e](https://about.gitlab.com/blog/2022/05/23/the-future-of-the-gitlab-web-ide/), \\n\u662f\u4ee5 VS Code \u6838\u5fc3\u5f15\u64ce [Monaco](https://microsoft.github.io/monaco-editor/)\\n\u958b\u767c\u6574\u5408\u800c\u4f86\u7684.\\n\\n\x3c!--truncate--\x3e\\n\\n> The Web IDE is built on top of the fantastic open source project, Monaco. \\n> What made Monaco a great choice as the foundation of the Web IDE \\n> is also what makes it more difficult to address all these concerns holistically. \\n> Monaco is just that: a foundation. We have to implement all these workflows \\n> and features ourselves. Meanwhile, another open source project has been \\n> laser-focused on delivering a lovable IDE on top of Monaco.\\n\\nVS Code \u78ba\u5be6\u662f Microsoft \u8fd1\u5e74\u4f86\u6700\u53d7\u6b61\u8fce\u80af\u5b9a\u7684\u7522\u54c1\u5c08\u6848. \\n\u4ee5 VS Code \u70ba\u57fa\u790e\u6574\u5408\u958b\u767c\u5176\u5be6\u5408\u7406. \u4f46\u56e0\u5fae\u8edf\u540c\u6642\u64c1\u6709 GitHub, \u6574\u4ef6\u4e8b\u8b8a\u5f97\u6709\u8da3.\\n\\n> It\'s interesting to me that GitLab is adopting a Microsoft product \\n> (VS Code) and Microsoft owns a significant competitor in GitHub. \\n> Nothing intelligent to say about that other than to wish \\n> I\'d been a fly on the wall for the discussions about that.\\n\\n[Hacker News](https://news.ycombinator.com/item?id=31487079)\\n\u4e0a\u8a31\u591a\u8a0e\u8ad6\u70ba\u4f55 GitHub \u8eab\u70ba GitLab \u6700\u5927\u7684\u5c0d\u624b, GitLab \u537b\u9078\u7528\u4e86\u5c0d\u624b\u6bcd\u516c\u53f8\u7684\u5c08\u6848\u4f5c\u70ba\u6838\u5fc3\u529f\u80fd.\\n\u9806\u4fbf\u628a\u66fe\u7d93\u88ab GitHub \u865f\u7a31\u7684 21 \u4e16\u7d00 IDE - [Atom](https://github.com/atom/atom) \u6293\u51fa\u4f86\u97ad\u5c4d\u4e00\u4e0b."},{"id":"/awesome","metadata":{"permalink":"/moco/news/awesome","source":"@site/news/awesome.md","title":"Awesome Resources","description":"This is News Clippins","date":"2022-05-20T00:00:00.000Z","formattedDate":"2022\u5e745\u670820\u65e5","tags":[{"label":"awesome","permalink":"/moco/news/tags/awesome"}],"readingTime":0.095,"truncated":true,"authors":[{"name":"kywk","title":"Site Maintainer","url":"https://github.io/kywk","imageURL":"https://github.com/kywk.png","key":"kywk"}],"frontMatter":{"title":"Awesome Resources","description":"This is News Clippins","date":"2022-05-20T00:00:00.000Z","authors":"kywk","tags":["awesome"],"image":"https://i.imgur.com/mErPwqL.png","hide_table_of_contents":false},"prevItem":{"title":"The Future of the GitLab Web IDE","permalink":"/moco/news/2022/05/24/gitlab-web-ide"}},"content":"\x3c!--truncate--\x3e\\n\\n## news & discus ##\\n\\n-   [Hacker News](https://news.ycombinator.com/)\\n-   [DEV Community \ud83d\udc69\u200d\ud83d\udcbb\ud83d\udc68\u200d\ud83d\udcbb](https://dev.to/)\\n-   [IT\u4eba](https://iter01.com/)\\n-   [MdEditor](https://www.gushiciku.cn/pl/)"}]}')}}]);